import solidworks from "./solidworks/solidworks";
import abaqus from "./abaqus/abaqus";
import ansys from "./ansys/ansys";
import matlab from "./matlab/matlab";
import autocad from "./autocad/autocad";
import photoshop from "./photoshop/photoshop";
import opensim from "./opensim/opensim";
import mimics from "./mimics/mimics";
import latex from "./latex/latex";
import python from "./python/python";
import illustrator from "./illustrator/illustrator";

const skills = [
  solidworks,
  abaqus,
  ansys,
  matlab,
  autocad,
  photoshop,
  opensim,
  mimics,
  latex,
  python,
  illustrator
];

export default skills;
